module.exports = function(url, messageModalObject){
    $.ajax({
		method: "POST",
		url: url,
		dataType: "text",
		cache: false,
		success: function(data){
            new messageModalObject(data);
		},
		error: function(status){
			console.error(status);
            new messageModalObject("Project doesn't exist.");
		}
	});
};
